import React from "react";
import Barredown from "./components/Barredown";

const MyTacos = () => {
  return (
    <div className="relative myFund container mx-auto bg-white h-3/5 w-2/4">
      <h1 className='uppercase text-3xl flex mx-auto text-center font-bold'>Compose ton tacos</h1>
      <Barredown />
    </div>
  );
};

export default MyTacos;
